import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import HeroSection from '../Herosection';
import Navbar from '../Navbar';

function Home(props) {

  const storeobj = {
    type: null,
    login: false
}
props.setLoginUser(storeobj)

  return (
    <>
      <Navbar NavPage='Home'/>
      <HeroSection/>
      <Footer/>
    </>
  );
}

export default Home;
